6dcda408-3099-4007-8526-c28d2d8c7c12	Названы лучшая и худшая книги о Гарри Поттере	Гарри Поттер;книги;литература	 Джоан Роулинг написала немалое количество книг, в которых рассказала про маленького волшебника Гарри Поттера. Каждая книга о нем по своему интересная, она рассказывает о жизни мага, его обучении и о препятствиях, которые ему и его друзьями приходится встречать на своем пути.\r\nНиколай Эппел, который является переводчиком, журналистом и филологом, решил провести анализ всех произведений писательницы Джоан Роулинг, в которых она рассказывает историю Гарри Поттера, чтобы составить собственный рейтинг от самой худшей книги, до лучшего произведения. После изучения всех произведений знаменитой писательницы, Николай Эппле пришел к выводу, что самой неудачной из всей серии книг оказалась книга с названием «Гарри Поттер и тайная комната». При этом он отметил, что эта книга не может даже называться самостоятельным произведением по причине того, что это только продолжение истории с названием «Гарри Поттер и философский камень», а потому самостоятельно она существовать не может. Именно по этой причине он и решил на самом последнем седьмом месте разместить книгу «Тайная комната». Шестое место заняло произведение «Кубок огня». Пятое место отдано «Философскому камню», четвертое – «Принцу-полукровке». В тройку лучших смогла войти книга «Орден Феникса». И все эти книги можно найти, зайдя в интернет-магазин книг о Гарри Поттере https://HPRosmen.ru/ . Немного до первого места не хватило произведению «Узник Азкабана». А вот самой удачной, а потому и оказавшейся на первом месте рейтинга филолога оказалась книга «Гарри Поттер и Дары Смерти», которая была выпущена самой последней, то есть седьмой. Стоит вспомнить, что первая книга про талантливо маленького волшебника, созданная Джоан Роулинг, была напечатана в 1997 году. За ней последовали и иные части увлекательной, невероятной истории. Последняя книга, получившая название «Гарри Поттер и Дары Смерти» была напечатана в 2007 году. Произведения оказались настолько интересными, что заинтересовали создателей кино. Всего было снято восемь коммерческих фильмов, каждый из которых оказался успешным. В настоящий момент стоимость бренда «Гарри Поттер» оценивается в пятнадцать миллиардов долларов. Благодаря этим своим книгам Джоан Роулинг на своей родине в Великобритании была признана самым продаваемым автором. По мнению редакторов разных журналов, писательница является в Великобритании самой влиятельной женщиной, а по версии Time стала «Человеком года». Именно благодаря юному волшебнику и его истории Джоан Роулинг стала мультимиллионером.	https://kulturologia.ru//news/6060/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
d4df8927-2d19-4aa8-8519-19a16c11c448	Написано в Лапландии: Фонд «Живая классика» готовит к выпуску уникальное издание	 Россия;книги;литература;Финляндия	 На днях в Париже официально открыли Международный год языков коренных народов, тем временем в российском Заполярье уже завершают работу над альманахом саамской литературы На двух языках и в таком объеме произведения литераторов этого малочисленного северного народа еще не публиковались. Для иностранных авторов, желающих разместить в альманахе свои работы, есть время до 15 февраля. Отбор текстов российских саамов уже завершен. Контуры книги, издание которой летом прошлого года анонсировала президент фонда Марина Смирнова на III международном поэтическом фестивале «Табуретка» в Мончегорске (Мурманская область), определились. И уже сегодня можно говорить, что труд этот будет без преувеличения масштабным и интересным. - Скажите, среди ваших знакомых много поэтов или писателей? Думаю, не ошибусь, если предположу, что у большинства их вовсе нет. Все же не такой это распространенный род занятий. Теперь представьте себе народ, представителей которого во всем мире наберется от силы 80 тысяч, а в России живет всего 1700 человек. Много среди них может быть людей пишущих? Оказывается, достаточно, чтобы взяв у каждого по несколько коротких произведений, хватило на целую книгу. Не считая зарубежных авторов, в альманахе будут представлены работы 26 российских саамов. - У саамов очень самобытная поэзия. Но она широко не известна. А так как у нас, благодаря Норникелю, появилась возможность издать альманах, мы решили, что это будет здорово, - рассказывает куратор проекта от фонда «Живая классика» Дарья Балакина. - Идея выпустить произведения саамских авторов, как говорится, витала в воздухе давно, но созрела окончательно в прошлом году после очередного фестиваля «Табуретка», на котором, по традиции, свои стихотворения читали и саамские поэты. Изначальная идея проекта — представить современное состояние саамской литературы. Стояло условие — произведения, отбираемые для альманаха, не должны быть нигде опубликованы ранее. Но в процессе работы от жестких рамок решили отказаться. - Главным нашим отличием от всех предшествующих сборников саамской литературы является билингвальность. Даже если произведения и были опубликованы ранее, они очень редко появлялись в печати на двух языках - русском и саамском, - объясняет Дарья Балакина. Интересный момент, в книге будут представлены переводы не только с саамского на русский, но и с саамского на саамский. Не удивляйтесь, Дело в том, что у этого народа несколько, скажем так, вариантов языка (да простят меня лингвисты). Некоторые ученые считают их диалектами, некоторые — отдельными языками общей группы. К примеру, в альманахе по словам одного из составителей, прозаика, члена Союза писателей России, саамской общественницы Надежды Большаковой, впервые будет издан ряд произведений первой саамской поэтессы Октябрины Вороновой на кильдинском диалекте (она писала на йоканьгском). - Знаете, многие тексты, особенно из архива, мне для альманаха пришлось набирать заново. И вы не представляете насколько это большой труд, - делится Надежда Большакова. - Саамских шрифтов у меня на компьютере нет. Приходилось отдельно копировать каждый символ и вставлять в кириллицу. Месяц, не поднимая головы сидела. На страницу могло и по 3-4 часа уходить. Но я рада, многое не публиковавшееся прежде, теперь увидит свет. Добавлю, чтобы понять объем работы над книгой нужно знать еще одну деталь. У российских саамов существует два варианта алфавита для кильдинского диалекта языка. Оба они основаны на кириллице, но имеют серьезные различия. И, поскольку свои сторонники есть у каждого, редколлегия приняла соломоново решение — оставить право выбора за авторами. - Мы не ставили никаких ограничений. Приняли решение публиковать все тексты на том из вариантов алфавита, который выбрали сами авторы. Хотелось бы зафиксировать состояние языка в том виде, в котором он существует сейчас. И без представления обоих алфавитов это сделать не получится, - уверена Дарья Балакина. Отразить состояние языка, не получилось бы и без разнопланового содержания. В альманахе будут представлены стихи, рассказы, сказки, песни, публицистика и даже перевод молитвы «Отче наш». - Проект направлен на поддержку саамской литературы и призван способствовать сохранению языков саамской группы. Кроме того, одна из целей - объединение саамов, проживающих в разных странах. Поэтому, хотя основной корпус авторов - представители саамского народа из Мурманской области, фонд «Живая классика» пригласил к участию и литераторов из Швеции, Финляндии, Норвегии. Насколько мне известно, аналогов этому проекту не существует, - говорит Дарья Балакина. В книгу войдут более 80 саамских текстов и свыше 100 переводов на русский язык. Почему переводов больше? Для некоторых произведений решили представить по 2-3 варианта, чтобы у читателей была возможность сравнить и выбрать приемлемый для себя. Ведь не секрет, что перевод художественных произведений — не только знание языка, но и культуры. Подобрать понятный аналог рожденным в Заполярье образам, зачастую не просто, впрочем, как и наоборот. - Тут нужно почувствовать саамскую жизнь, Север. Представить это человеку, выросшему и живущему в других условиях сложно. Знаете, когда у нас в свое время переводили Есенина на саамский, то в стихотворении лошадей заменили на оленей. А что делать? Нужен был близкий читателю образ, - объясняет Надежда Большакова. Решение сопроводить все тексты в альманахе переводом на русский — принципиальное. Одна из задач — развитие интереса к саамской культуре. И без перевода достичь ее не удалось бы. - Я всегда со своими коллегами спорила. Считаю, не нужно выпускать книги только на саамском. Кто умеет, конечно, прочтет. Но носителей языка не так много. Сейчас у нас (имеется в виду Мурманская область, - Авт.) хорошо на родном языке говорят, дай Бог, 100 человек. Еще 300 владеют им на бытовом уровне, - полагает Надежда Большакова. - А если на двух языках делать - аудитория шире. И интересно это будет самим саамам — педагогам, воспитателям. В книге очень много маленьких стихотворений, которые можно разучивать, скажем, со школьниками на занятиях. Это важно, я знаю на собственном опыте, считалки, песни позволяют легко дать детям какие-то первые языковые навыки. А еще альманах в таком виде позволит через переводы прикоснуться к нашей культуре не саамам. Поэтому книга эта и для саамов, и для русских. Альманах планируют выпустить к маю. Издание не коммерческий проект. Более того, тираж вообще продавать не будут. Но, при этом, в фонде «Живая классика» обещают сделать книгу максимально доступной. Бумажную версию подарят библиотекам, учреждениям культуры Мурманской области (для этого региона саамы — коренные жители), общественным организациям, защищающим права малочисленных народов и, конечно, авторские экземпляры получат писатели и поэты, чьи произведения вошли в альманах. - Электронную копию мы разместим на сайте проекта (samialmanac.ru), а также в «Северной библиотеке» на сайте sever1000.ru, - пообещала Дарья Балакина.	https://kulturologia.ru//news/6053/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
f55d386a-0e4e-4bad-90e4-1e37e6dd6e72	В Буэнос-Айресе открылась выставка победителей фотоконкурса имени Андрея Стенина	Буэнос-Айрес;конкурс;фотография	 5 февраля в Буэнос-Айресе состоялось открытие выставки, экспонатами которой стали работы призеров и победителей международного конкурса фотожурналистики имени Андрея Стенина, фотокорреспондента МИА «Россия сегодня», который погиб на востоке Украины. Местом проведения данной выставки выбрали Российский центр науки и культуры. На церемонии открытия выставки присутствовали такие почетные гости как Дмитрий Феоктистов, российский посол в Аргентине, и Алексей Волин, заместитель министра связи, массовых коммуникаций и цифрового развития. В зале Русского центра науки и культуры, который выбрали для проведения выставки, всего представлено более 30 работ. Ольга Муратова, глава представительства Россотрудничества на территории Аргентины, рассказала, что данная выставка продлится до 18 февраля. После нее лучшие конкурсные фотографии планирую перенести на одну из самых крупных городских площадок аргентинской столицы, города Буэнос-Айрес. Алексей Волин во время торжественной церемонии выступил с речью. Он рассказал, что очень рад тому, что в данный момент в «Русском доме» собралось большое количество фотографий сделанных в разных уголках нашей планеты, лучшими фотографами из разных стран. Он назвал это не случайной, а логичной закономерностью, так как традиционно Россия привыкла вбирать в себя всех. Также происходит и в Аргентине. Это общая черта двух стран, которая их роднит. Не остался в стороне и российский посол Дмитрий Феоктистов. Он рассказал о том, что современная Аргентина проявляет большой интерес к России и это очень хорошо. По этой причине очень важно как можно чаще организовывать разнообразные культурные мероприятия, в том числе и выставки, которые смогут больше рассказать о современной Российской Федерации. Стоит вспомнить, что на конкурс фотографий в 2018 году всего поступило около шести тысяч работ. Их присылали художники из 77 стран мира. Отбор лучших работ проводили в четырех номинациях, которыми были: «Портрет. Герой нашего времени», «Спорт», «Главные новости» и «Моя планета». Определяли лучшие работы еще в категориях «Серия» и «Одиночная фотография». В числе победителей оказались работы фотографов из 14 стран: ЮАР, Ирана, Кении, России, Белоруссии, Германии, Индии, Израиля, Ирака, Испании, Италии, Турции, Египта и Бангладеш.	https://kulturologia.ru//news/6052/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
c155bd3c-f331-47fd-ac45-f90bb433683f	Мария Степанова стала лауреатом литературной премии «НОС-2018»	книги;литература;премия	 По итогам прошедшего сезона был определен лучший писатель. В этот раз жюри престижной литературной премии с названием «НОС-2018» выделило Марию Степанову. Престижную награду она получили за свою работу над книгой «Памяти памяти». Торжественная церемония вручения литературной премии была проведена в Театральном центре, который находится на Страстном бульваре, 4 февраля. Во время церемонии с речью выступила Екатерина Шульман, входящая в состав жюри. Она рассказала, что посчитала в этот раз достойной литературной премии именно писательницу Марию Степанову. Ее новая работа является значимым произведением, мимо которого нельзя пройти и не отметить его. Многие иные члены жюри поддержали Шульман, посчитали, что писательница Степанова действительно хорошо поработала над созданием своей книги. В процессе определения лучшего писателя года участие принимали не только члены жюри, а и представители культурной общественности, эксперты. При определении лучшего проводилась публичная дискуссия. Премия «НОС» была создана десять лет тому назад. Эта премия от многих остальных отличается тем, что решение о том, кто же в очередной раз будет назван победителем, принимается в открытых дебатах. Об этом рассказала Ирина Прохорова, занимающая в издательском доме «Новое литературное обозрение» должность главного редактора. Она отметила, что создание данной премии было попыткой поговорить о политике, общественности, обо всем что происходит и окружает современного человека, через разговоры о культуре. В этот раз председателем жюри выступила Анна Наринская – литературный критик. Также среди его членов были Марина Давыдова – театральный критик, Екатерина Шульман – политолог, Татьяна Венедиктова – профессор МГУ, Агнешка Пиотровская – переводчик и прочие. Победительнице во время церемонии вручили статуэтку и денежную награду в размере 700 тысяч российских рублей. Кроме Степановой на звание лучшего писателя претендовали: Людмила Петрушевская с работой «Нас украли. История преступления», Анна Немзер с произведением «Раунд. Оптический роман», Денис Горелов с книгой «Родина слоников», Наталья Мещанинова с книгой «Рассказы», Юрий Лейдерман с работой «Моабитские хроники», Ксения Букша с произведением «Открывается внутрь», Алла Горбунова с работой «Вещи и уши», Виктор Пелевин, написавший «iFuck 10». Стоит отметить, что последнее произведение завоевало приз зрительских симпатий. А вот академия критиков литературной премии «НОС» решила отметить Людмилу Петрушевскую.	https://kulturologia.ru//news/6051/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
85524e72-b71e-427f-b19e-c617137325d3	В немецком музее выставили изрезанную картину Бэнкси, на всякий случай выключив шредер	Бэнкси;выставка;картина	 Еще не забылась история о том, как после продажи на аукционе Sotheby's чуть полностью не самоуничтожилась работа знаменитого уличного художника Бэнкси «Девочка на воздушном шаре». Данный аукцион проводился в октябре 2018 года в Лондоне. Теперь же это произведение искусства выставляется в музее города Баден-Баден. Перед тем как выставить картину в зал, специалистами данного музея были проведены работы по полному отключению шредера, чтобы тот случайно вновь не запустился, и не уничтожил работу Бэнкси окончательно. Владелица картины, которая после частичного разрезания получила название «Любовь в мусорной корзине», так и остается неизвестной, так как предпочитает сохранять анонимность. В данный момент эта работа уличного художника находится в долгосрочном займе у музея, который находится в Штутгарте. Временно она будет выставляться в Баден-Бадене, в музее Фридера Бурда. На новом месте картина будет выставляться до 3 марта. По окончании выставки, это произведение искусства перевезут в Штутгарт, в Государственную галерею. В иностранных изданиях акцентируют внимание на то, что выставка, частью которой стала наполовину уничтоженная картина, проводится бесплатно. Деньги с посетителей не берут, объясняя это тем, что Бэнкси был бы недоволен данным фактом, так как всегда говорит о том, что его искусство должно быть доступным для каждого человека. Во время активации шредера на аукционе работа художника должна была быть полностью уничтожена. Таковым был замысел художника. Чтобы устройство вновь не активировалось и не доделало свою работу. Музейные специалисты решили его полностью отключить. Обезвреживание шредера, встроенного в раму проводилось музейным работником прямо на глазах у фотографов и журналистов. Впервые рисунок девочки с воздушным шариком в виде сердца появился в 2002 году в районе Лондона Шордич на стене типографии, расположенной на улице Грет Истерн. По результатам голосования 2017 года эта работа таинственного художника была признана любимым британским произведением искусства. Данной работе удалось обойти даже работы национальных пейзажистов и портретистов. После случая на аукционе с разрезанием картины, Бэнкси рассказал, что специально встроил шредер в картину, чтобы тот смог ее уничтожить, если работа будут выставлена продажу на каком-то из аукционов.	https://kulturologia.ru//news/6050/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
4ac34b2e-c4a4-40e4-b3f6-00f009bc706e	ВСС разработал единый стандарт для страхования музейных предметов	 общество;BCC;музеи;страхование	 Всероссийским союзом страховщиков был недавно разработан новый проект. В данном документе содержаться правила, по которым должно проводиться страхование предмета, если тот является шедевром мирового искусства или предметом отечественного исторического наследия. В разработке данного проекта принимали участие представители Банка России и Министерства культуры. Представители союза страховщиков акцентировали внимание на необходимости разработать условия страхования, которые будут едиными для всех. Стандартные правила предусматривают подписание договора страхования в ситуациях, когда предмет искусства покидает стены музея, где храниться постоянно и отравляется в иной выставочный зал, где будет выступать в качестве элемента экспозиции. В соответствии с разработанными новыми стандартами, договор страхования музейных экспонатов будет покрывать все риски. За исключением некоторых ситуаций, но и о них можно будет договориться, за дополнительное вознаграждение страховой компании. При страховании по новым стандартам страховые компании будут ответственными за сохранность объекта от начала его монтажных и демонтажных работ до окончания выставки в ином зале. Компании, которая берется за страхование столь ценных объектов, предстоит следить за всеми действиями, такими как упаковка, временное хранение до момента погрузки, за самой погрузкой и последующей разгрузкой на новом месте, перегрузкой, если таковая проводится, временным хранением до открытия выставки. Во время выставки страховщик также должен обеспечить сохранность застрахованного предмета искусства. Это стандартные условия страхования. В соответствии с новым проектом страховая компания и ее клиент могут договориться и про иные сроки страхования объекта. Если застрахованный предмет искусства во время срока договора получит повреждения, реставрация го будет проведена полностью за счет страховой компании. Если такой предмет будет полностью утрачен, страховая компания должна выплатить владельцу этого произведения или государству компенсацию в размере страховой сумму. Сумма эта определяется еще перед подписанием договора страхования на основании экспертной оценки. Разработкой проекта занималась рабочая группа, ответственная за страхование предметов искусства из музеев. Эта группа была создана в начале прошлого 2018 года. Новые стандарты в скором времени будут рассматривать на совещании в Министерстве культуры, после чего их могут отправить на доработку. В силу проект может вступить во втором квартале этого года.	https://kulturologia.ru//news/6049/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
e0e2ed59-2d11-471e-90a9-44f0feec2ed5	Сын Сэлинджера сообщил о подготовке к публикации неизданных произведений писателя	роман;Сэлинджер	 В одной из британских газет рассказали о том, что в скором времени будут опубликованы работы Джерома Дэвида Сэлинджера, о существовании которых ранее никому не было известно. Об этом рассказал сам Мэтт Сэлинджер – сын известного американского классика, который многим запомнился своим романом под названием «Над пропастью во ржи». Мэтт не отрицает этого. Во время своего интервью он отметил, что отец в течение продолжительного времени предпочитал жить в одиночестве. Проживал он в штате Нью-Гэмпшир, в городе Корниш. До самой своей смерти он не прекращал писать. Все произведения, которые он успел создать и ранее никому неизвестные, будут опубликованы. В соответствии с пожеланиями своего отца, Мэтт должен собрать все работы и опубликовать их. Дело это непросто и не быстрое, так как 50 лет Джером Дэвид Сэлинджер не публиковался, и у него скопилось большое количество произведений. В публикацию должны поступить все произведения одновременно, а потому подготовительные работы займут много времени. Судя по объемам, Мэтту потребуется несколько лет, чтобы завершить то, о чем его просил отец. Он надеется, что сможет сделать этот в ближайшее десятилетие. Было уточнено, что к работе по подготовке всех работ публикаций Мэтт приступил уже на следующий год после смерти отца, в 2011 году. Ему в этом помогает Колин О’Нил – вдова писателя. Работать они стараются максимально быстро. Вспоминая об отце, Мэтт рассказывает, что в его голове было огромное количество мыслей и идей, чтобы их записать, он мог неожиданно остановить автомобиль в дороге. По всему его дому лежали блокноты для записей. Джером Дэвид Сэлинджер выбрал для себя уединенную жизнь, так как считал, что взаимодействие с людьми негативно сказывается на его литературной деятельности. Особенно он избегал общения с лицами, которые имеют отношение к литературе. Того же он желал и всем остальным людям, которые имеют писательский талант и желают развиваться в данном направлении. Никаких подробностей о неизвестных произведениях классика не известно. Предполагается, что в них будет рассказываться про семью Глассов, члены которой станут участниками разных произведений. Новые произведения могут быть после печати восприняты неоднозначно, по мнению Мэтта, но они обязательно понравятся настоящим читателям.	https://kulturologia.ru//news/6047/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
382d4e20-2d49-416a-9b7f-2c948c936d20	Белорусский фильм «Периферия» победил на международном фестивале мобильного кино	 кино; фильм	 На международном фестивале velcom Smartfilm, участниками которого были исключительно фильмы, снятые на мобильный телефон, определили победителя. Лучшим в этот раз признали картину с названием «Периферия», режиссером которой является Варвара Щука из Белоруссии. Всего в этот раз в конкурсе принимало участие 334 мобильных фильма, присланных из 61 страны. Победитель фестиваля получил три тысячи белорусских рублей, что составляет приблизительно 1,4 тысячи долларов. К денежному призу прилагались дополнительно новый смартфон и всевозможные аксессуары. Всего в финал конкурса velcom Smartfilm прошло 11 работ. Для финала жюри отобрало два фильма, созданных в Белоруссии. Также среди лучших картин оказались мобильные фильмы, присланные из Гонконга, России, Мартиники, Египта, Нигерии, Великобритании и Колумбии. Во время определения лучшего мобильного кино выступил Юрий Сукманов, который является программным директором «Листопада» - Минского международного кинофестиваля. По его словам, главный приз такого конкурса должна получать не та работа, которая нравиться зрителям по разнообразным критериям, а фильм, который заставляет каждого зрителя думать. Во время своей речи Сукманов рассказал, что мобильное кино, завоевавшее главный приз мероприятия, имеет свои недостатки, и обладает определенными преимуществами. Главное в нем – это то, что при его просмотре никто не смог остаться равнодушным. И все потому, что все происходящие события связаны с нынешней реальностью, в которой сегодня приходится жить людям. Первое место жюри решило присудить работе британского режиссера Мэтта Биггса с названием «Дикая природа: Леса подводного мира». На втором месте фестиваля velcom Smartfilm оказался фильм Ванг Хои, режиссера из Гонконга, с названием «Сонатина». В тройку лучших вошло кино «Искушение», созданием которого занимался Артем Бордовский из Белоруссии. Награду «Лучший байопик» решили присудить работе с названием «Радио», которая создавалась в Египте. За лучший сценарий была отмечена мобильная лента «Беглецы» из Колумбии. Стоит отметить, что определением лучших, занималось не только профессиональное жюри. Было привлечено и так называемое народное жюри, которое создавалось после прохождения каждым желающим специального кинотеста. Народное жюри лучшим посчитало кино Арины Салахутдиновой из России с названием «Путешествие». Фестиваль velcom Smartfilm был проведен уже в восьмой раз. Он является площадкой, где объединяются технологии и искусство. С каждым годом количество работ увеличивается, что говорит о хорошей репутации мероприятия и его популярности.	https://kulturologia.ru//news/6046/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
c981a770-b57c-4a1f-9840-9ce05597392a	Найденные в Ессентуках неизвестные снимки Николая II передали в музей УФК по Ставрополью	 Россия;Николай II;фото	 Во время проведения ремонта крыши казначейства в Ессентуках были найдены фотографии царской семьи и Николая II. Ранее о существовании данных фотографий не было известно. О такой находке рассказала Вера Самарина, занимающая должность заместителя руководителя УФК по Ставропольскому краю, которая является еще начальником поискового отряда с названием «Казначей 26». Всего было найдено семь фотографии и две фотооткрытки. В данный момент эти ценные кадры находятся в ведомственном музее. Самыми ценными из этих объектов являются фотооткрытки, так как на них присутствуют автографы цесаревича Алексея и одной из цесаревен. Фотографии XIX были найдены простыми рабочими, во время проведения работ по ремонту кровли в здании отдела №26 УФК, что в городе Ессентуки. Они случайно сохранились и были переданы в ведомство, при котором действует музей. Изучением фотографий и подлинностей автографов на фотооткрытках занимаются специалисты. Здание, в котором велись ремонтные работы, является особняком с мезонином. Построен он из кирпича, имеет два этажа и считается одним из самых старых сооружений в Ессентуках. Кровля в здании не ремонтировалась более века. При проведении таких работ под одной из балок рабочими и был обнаружен пакет, внутри которого оказались фотографии. Самарина рассказала о высокой ценности находки. Специалисты еще занимаются проведением экспертизы, но они с полной уверенностью уже говорят о том, что находка представляет собой подлинные фотографии. Ранее такие снимки никто не видел, они нигде не выставлялись и не печатались. В том, что фотографиям больше стал лет, нет никаких сомнений. На двух из найденных снимков присутствует лейб-казак Анатолий Федюшким. Об этом рассказал историк, краевед Роман Нутрихин. Он высказал предположения, что все найденные снимки и фотооткрытки принадлежали именно ему. Этот казак принимал участи в Первой мировой войне. Когда в 1918 году он примкнул к казачеству Северного Кавказа, он и мог спрятать фотографии под кровлей особняка. В данный момент поисковики желают найти специалистов, которые смогут провести реставрацию снимков. Это необходимо для их дальнейшего сохранения. Планируется проведение идентификации всех, кто изображен на фотографиях и фотооткрытках.	https://kulturologia.ru//news/6045/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
f6b2f47a-1386-4c18-a8c0-586dd8eba331	Ростех подвел итоги всероссийского конкурса индустриальной фотографии	 Россия;конкурс;фотография	 Во все времена индустриальная фотография привлекала к себе внимание, интерес к ней не угас и сейчас. Об этом свидетельствует выставка #БериФокусНаРостех, которую организовал «Ростех». Всего за несколько недель с заявками на участие в конкурс поступило свыше тысячи фотографий, сделанных 70 фотографами из разных регионов Российской Федерации. Индустриальная фотография становится все более популярной, интерес к ней повышается из-за развития отечественной промышленности. Большое количество работ, присланных на конкурс, поставило перед жюри непростую задачу определить лучшую фотографию. Сделать это членам комиссии было непросто, так как многие снимки были сделаны на очень высоком профессиональном уровне. При выборе лучшего жюри смотрело на целостный образ промышленного объекта, оригинальность идеи фотографа, а также качество реализации данной идеи.\r\nСтиль и тему каждый участник выбирал самостоятельно. «Ростех» помогал только с интересными локациями, организовывал фототуры по предприятиям страны: «Росэлектроника», «Техмаш», Мариинский прииск, «Вертолеты России» и пр., всего 24 предприятия. Трех лучших фотографов и их работы определили 28 января. Каждому фотографу из тройки лучших были вручены призы в виде профессиональной фототехники от ведущего производителя «Швабе», входящего в состав «Ростеха». Первое место завоевал Андрей Захаров, со своим снимком, который был сделан в Самаре на ПАТ «Кузнецов». Он стал обладателем новейшей модели фотообъектива с названием Zenitar 0,95/50. Второе место жюри решили присудить Александру Рудному за его снимок с названием «Изумрудная шахта». Данная фотография была сделана им в Свердловской области в поселке имени Малышева, где проводился фототур по Мариинскому прииску. За этот снимок фотограф был награжден объективом Helios. Фотограф Константин Ильинский со своей фотографией «Матрица четвертого порядка», который был сделан на «Оптроне» - московском предприятии. Данная работа фотографу принесла третье место, за которое ему вручили Zenitar 2,8/16 – это сверхширокоугольный объектив, который обладает эффектом «диагональный рыбий глаз». Екатерина Баранова, занимающая в госкорпорации «Ростех» должность директора по коммуникациям, отметила, что фотографам, чьи работы не смогли в этот раз завоевать приз, не стоит расстраиваться, у них еще будет такая возможность в новых конкурсах, которые будут проводиться неоднократно.	https://kulturologia.ru//news/6044/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
f69080d4-b9e3-4f48-8a3c-035c2bfb6187	Русский музей пополнит свою коллекцию лучшими работами на биеннале современной фотографии	Русский музей;фотографии	 В пресс-службе Государственного Русского музея рассказали об открытии пятого Фотобиеннале современной фотографии. При подведении итогов мероприятия будут определены лучшие работы и эти фотографии войдут в коллекцию Русского музея. В 2009 году Русским музеем был придуман такой крупный выставочный проект. В этот же год была проведена первая музейная Биеннале современной фотографии. Целью данного мероприятия является определение новых тенденций в современной фотографии, поиск новых мастеров в области фотографии, привлечение внимания общественности и меценатов к талантливым новым фотографам. В течение всего года отбиралась фотографии, которые будут принимать участие в очередном конкурсе современной фотографии. Прислать фотографию, с надеждой стать участником мероприятия, или даже стать победителем, мог каждый гражданин Российской Федерации. В этом конкурсе нет никаких ограничений по возрасту кандидатов, их стажу в работе с профессиональной фотографией. В пятый по счету конкурс были отобраны работы 295 мастеров, которые подали свои заявки на участие в конкурсе из 71 населенного пункта страны. В этот раз тему выставки решили взять достаточно широкую: современная фотография во всех жанрах и во всех видах. Во время проведения данного масштабного мероприятия зрители будут голосовать за ту работу, которая им пришлась по душе больше всего. Организовано было как прямое голосование, так и электронное. После того, как выставка завершиться, специалистами Государственного Русского музея будут выбраны лучшие работы фотографов и добавлены в музейную коллекцию. На сайте музея говорится о том, что каждый фотограф, отправивший свою заявку на конкурс, понимает, что его работа может стать лучшей и быть выбранной для пополнения коллекции музея, а также со всеми вытекающими из этого последствиями. Такими последствиями является передача в музей авторских отпечатков и отказ от авторских прав на свою работу, что даст право Русскому музею в дальнейшем на свое усмотрение использовать фотографию для публикации в разнообразных изданиях и в качестве составляющей разнообразных выставочных экспозиций. Выставка продлиться до 25 марта. Авторы работ, которые больше всего придутся по душе, получат дипломы от Русского музея. А вот вручение денежных призов проведение такого мероприятия не предусматривает.	https://kulturologia.ru//news/6043/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
53130be7-306d-4f06-bffa-d47d3f8bb1d2	На аукционе в Нью-Йорке гравюру Дюрера продали за $612 тыс.	 аукцион;гравюра;Дюрер	 29 января в Нью-Йорке проводился аукцион, на котором было продано немало количество произведений искусства старых мастеров. Самым дорогостоящим объектом оказалась гравюра, создателем которой был всемирно известный мастер Альбрехт Дюрер, живший с 1471 года по 1528 год. Его работу с названием «Четыре всадника Апокалипсиса» удалось продать за 612 тысяч долларов. Столь высокая цена сделала гравюру самым дорогим лотом на прошедшем аукционе Christie's. В пресс-службе данного аукционного дома рассказали, что эту свою работу Дюрер, относящихся к числу мастеров западноевропейского Ренессанса, создавал в 1497-1498 годах. Хранилось данное произведение искусства в Соединенных Штатах Америки, на Тихоокеанском побережье и было частью частной коллекции. Перед продажей специалистами была проведена оценка этой гравюры и назначена стоимость, которая оказалась практически в два раза меньше цены, которую решил заплатить теперь уже новый владелец гравюры. К числу самых дорогих лотов прошедшего в Нью-Йорке аукциона относится картина с названием «Успение Богородицы», которая создавалась в 1470-1474 годах. Ее создателем является немецкий живописец Мартин Шонгауэр, живший с 1445 года по 1491 год, трудившийся в период раннего Возрождения. Некоторое время данное произведение искусства принадлежало Карлу Фердинанду Фридриху фон Наглеру, генерал-почтмейстеру из Пруссии, который известен в качестве создателя современной почтовой службы Германии. После она успела побывать еще частью нескольких частных коллекций. За эту работу на аукционе заплатили 492 тысячи долларов. За 372 тысячи долларов была продана работа с названием «Мадонна Айнзидельна». Это произведение мастера, имя которого неизвестно. Известными являются только его инициалы E.S. и что мастер этот работал в 1450-1456 годах. Название Айнзидельн носит паломнический центр в Швейцарии. Данный центр возник вокруг бенедиктинского аббатства, которое в свою очередь здесь было основано еще в 934 году. Сотрудники аукционного дома Christie's при проведении оценки этого произведения назвали его очень редким. Ранее картина была составляющей частью частной коллекции младшего сына Августа III, короля Польши, носившего имя Альберт Казимир август Саксонский. Всего на продажу аукционный дом Christie's выставил около 150 лотов. Все это гравюры, созданные старыми мастерами. Всего от продажи этих работ удалось выручить сумму в 2,74 миллиона долларов.	https://kulturologia.ru//news/6041/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
f84d71b8-881f-4c0d-a00f-d2211b4b3b3e	Фильм «Т-34», ради которого сдвигали все мировые премьеры, обогнал Джека Воробья и стал вторым по кассовости в РФ	 кино; фильм;премьера;Т-34	 На официальной страничке в одной из социальных сетей продюсер Рубен Дишдишян, который является еще и главой компании «Марс Медиа», рассказал, что в рейтинге самых кассовых фильмов за всю историю отечественного кинематографа, вторую строчку заняла лента с названием «Т-34». На официальной страничке в одной из социальных сетей продюсер Рубен Дишдишян, который является еще и главой компании «Марс Медиа», рассказал, что в рейтинге самых кассовых фильмов за всю историю отечественного кинематографа, вторую строчку заняла лента с названием «Т-34». Уступил этот проект только фильму «Движение вверх». Этой истории о побеге танкистов из немецкого плена удалось даже обойти «Пиратов Карибского моря: Мертвецы не рассказывают сказки». Если брать все фильмы, которые были показаны на больших экранах страны, то за всю историю больше денежных средств помимо спортивного фильма «Движение вверх», больше «Т-34» собрал только фильм «Аватар». В этом своем сообщении продюсер поздравил всех, кто принимал участие в создание этого фильма. За все время в прокате фильм «Т-34» собрал больше двух миллиардов рублей. Такие данные были зафиксированы Единой автоматизированной информационной системой. О том, что данная кинокартина может по кассовым сборам занять вторую позицию в рейтинге, в том числе и с учетом фильмов, созданных Голливудом, рассказал еще Владимир Мединский, возглавляющий Министерство культуры. «Т-34» вышел на большие экраны страны в первый день нового 2019 года. Чтобы у данной ленты было минимум соперником, Министерством культуры были смещены все остальные премьеры – они состоялись раньше. Именно по этой причине 13 декабря прошли премьеры мультфильма «Гринч», кинокомикса «Аквамен», спин-оффа «Трансформеров» - «Бамблби», мультфильма про Человека-паука. Не все поняли, почему в прокат фильм про танковый экипаж решили пустить именно с 1 января. Некоторые зрители назвали данную историю ремейком, да еще и не самым удачным, фильма «Жаворонок», снятого в 1965 году. Старый фильм также рассказывает про бегущих из плена танкистов. Фашистские захватчики использовали танк Т-34 в качестве мишени, которая им помогала улучшать собственные противотанковые орудия. Написанием сценария к этому фильму занимались Михаил Дудин и Сергей Орлов. В его основу легла легенда о пленных русских, которым во время очередного испытания немецкого оружия удалось сбежать с полигона. Рассказывали ее в ГДР.	https://kulturologia.ru//news/6039/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
358cdb5f-e6af-40e5-b62c-9b8e7b8f9607	Из футболистов в артисты: Музыканты и актеры, которые мечтали о футболе	артисты;музыканты;футбол	 Среди известных персон немало лиц, которые в свое время и не мечтали о большой сцене, а желали стать профессиональными футболистами. Многим из них уже за 40 лет, а потому их желанию не суждено сбыться. Желание стать футболистом было у певца Сосо Павлиашвили, которому уже 54 года. С самого детства он проявлял интерес к этой спортивной игре и любую свободную минуту посвящал именно ей, вместе с другими мальчишками на футбольном поле. Сейчас Сосо практически сам в футбол не играет, зато остается поклонникам этого вида спорта. Владимир Кузьмин еще в детстве написал песню с название «Мячик» и было это после того, как получил в качестве подарка от мамы футбольный мяч. Тогда музыканту было 10-11 лет, сейчас уже 63 года. В детстве, еще мальчишкой он мечтал стать профессиональным футболистом и достигнуть уровня Джорджа Беста, Валентина Иванова, Валерия Воронина. Судьба сложилась иначе, и Кузьмин стал музыкантом, вот только любовь его к футболу никуда не делась, а потому в течение многих лет он входил в состав любительской футбольной команды. Музыкальную карьеру не планировал строить и Юрий Лоза. В 12 лет он начал играть в футбол, так как считал, что футболисту будет легче покорять сердца девчонок. Вот только он ошибся и девчонкам больше нравился его друг, игравший на гитаре. Тогда и он попросил у родителей гитару. Увлечение футболом при этом не прошло, и долгое время Юрий еще играл в команде артистов с названием «Старко». Сейчас в свои 64 года играть он уже не может из-за запрета врачей, но при этом остается болельщиком. О своей любви к футболу рассказал Александр Петров. Это было не просто желание, а настоящая мечта играть за «Спартак» на лучших стадионах. У него была возможность стать профессиональным спортсменом, но что-то не сложилось, и Петров стал востребованным актером. И все же частично воплотить мечту ему все же удалось. Сейчас он принимает участие в съемках фильма, который выйдет в 2020 году. Он играет главную роль Эдуарда Стрельцова – олимпийского чемпиона, легендарного советского союза. Кстати, в свободное время актер встречается с друзьями, с которыми охотно гоняет мяч. Известный шоумен Николай Фоменко рассказал, о том, что играл в футбол и играл много, к тому же его считали подающим надежду, вот только становиться профессиональным спортсменом он не захотел в то время, когда пришлось делать выбор, по какому пути двигаться дальше. Уже в то время он успел хорошо проявить себя в юношеском театре. А потому решил все-таки оставить футбол, но при этом не забыл про него, остается активным болельщиком, и не отказывается с друзьями сыграть в мяч.	https://kulturologia.ru//news/6048/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
607f4bb4-d7cb-4efe-9f11-3ac21efd9f3a	Ведущими «Евровидения – 2019» станут бывшая девушка Ди Каприо и влиятельный гей	 музыка; события;Ди Каприо;Евровидение	 На официальном сайте «Евровидения – 2019» появилось новое сообщение, в котором называются имена ведущих. Ведущими международного музыкального конкурса будут четыре человека. В этот раз проведение столь важного мероприятия в области музыки доверили поэтессе Люси Айоуб, телеведущему Асси Азар, продюсеру и шоумену Эрез Таль и израильской супермодели Бар Рафаэли. Организаторы свой выбор обосновали. Последний музыкальный конкурс, который проходил в 2018 году в Лиссабоне доверили проводить исключительно ведущим женщинам. Годом ранее, то есть в 2017 году, когда «Евровидение» проходило в Киеве, ведущими выбрали только мужчин. Теперь настало время, когда проведением всемирного важного музыкального конкурса будут заниматься одновременно и женщины, и мужчины. Сегодня Бар Рафаэли тридцать три года. Всемирно известное печатное издание Maxim, точнее американское издание данного журнала, назвало ее самой сексуальной женщиной. И было это в 2012 году. Некогда Бар была возлюбленной известного на весь мир актера Леонардо Ди Каприо. Они начали встречаться в 2005 году, но любовь их оказалась непродолжительной и пара распалась уже в 2009 году. Иной ведущий предстоящего музыкального конкурса по имени Асси Азар, которому сейчас 39 лет, знаменит своей борьбой за права представителей сексуальных меньшинств. По версии журнала с названием Out Азар вошел в перечень самых влиятельных геев всего мира. В этот список имя телеведущего было добавлено в 2009 году. Третья ведущая Люси Айоуб, которой сейчас 26 лет, помимо того, что является поэтессой, работала еще и телеведущей. Она принимала участие в съемках культурных программ. Четвертым ведущим и вторым мужчиной среди них является Эрез Таль, которому 57 лет. Он занимался продюсированием телевизионных шоу «Бункер» и «Большой бат», в которых еще и выступил ведущим. Стоит вспомнить, что немного раньше, было названо имя возможного представителя Российской Федерации – Сергей Лазарев. В 2019 году престижный музыкальный конкурс будут проводить в израильском городе Тель-Авив. Полуфиналы намечены на 14 и 16 мая. Финальное выступление, в котором определиться победитель этого года, состоится 18 мая.	https://kulturologia.ru//news/6038/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
198fe7fc-317b-4b2e-910e-07fcc7e63335	Warner Bros снимает полнометражный фильм «Том и Джерри»	Warner Bros;мультфильм;Том и Джерри	 История про вечное соперничество мышонка по имени Джерри с котом Томом, многим известна и многими любима. На просмотре таких мультфильмов выросло не одно поколение. В компании Warner Bros решили немного поработать над преображением мультипликационного сериала «Том и Джерри». В компании решили, что к съемкам новой истории приступят уже летом текущего 2019 года. Интересно, что это будет не мультфильм, а настоящее игровое полнометражное кино. В нем все также будут показываться сложные отношения, которые сложились между мышонком Джерри и котом Томом. В качестве режиссера был приглашен Тим Стори, который ранее был задействован в создании многим полюбившихся фильмов про фантастическую четверку: «Фантастическая Четверка» и «Фантастическая Четверка: Вторжение Серебряного Серфера». В рамках нового проекта знаменитой киностудии классическая съемка, в которой принимают участие живые актеры, будет совмещена с CGI- анимацией. В компании уже даже определились с местом, в котором будут проводиться съемки – это будет Англия. Создание полнометражного кино про Тома и Джерри, это не первая попытка соединить живых актеров и мультяшных героев Тома и Джерри. Еще в 2003 году был снят подобный непродолжительный видеоролик. Это была реклама автомобиля Ford Mondeo, которую можно найти и посмотреть на видеохостинге YouTube. В анимационную франшизу Том и Джерри входят сотни коротких мультфильмов. Продолжительность каждой серии составляет всего несколько минут. Первый мультфильм получил название «Кот получает пинка» и был выпущен в 1940 году. Его создателями стали Джозеф Барбера и Уильям Ханна, на создание его их благословил продюсер Фред Куимби. С этого мультфильма и началась полюбившаяся всем история. Суть каждой серии заключается в том, что Том старается поймать мышонка Джерри, но в силу сложившихся обстоятельств сделать у него этот никак не получается, он вечно попадает в неприятности. Иногда эти неприятности подстраивает и сам Джерри со своими товарищами. Большую популярность первых серий мультфильма связывают с музыкальным сопровождением, над которым трудился композитор Скотт Брэдли. Мысль об этом приходит после того, как становится ясно, что первые серии анимационного сериала оказались более успешными по сравнению с новыми историями неугомонной парочки.	https://kulturologia.ru//news/6037/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
c9b8b0d8-5822-4754-a437-c77d5c576fed	Чеченский писатель подал в суд на режиссера «Аватара» Джеймса Кэмерона	 США;Аватар;Джеймс Кэмерон;Чечня	 Писатель Руслан Закриев из Чечни пообщался с новостными изданиями. Он рассказал им о подаче искового заявления в Заводской районный суд Грозного. Данный иск направлен против Джеймса Кэмерона, известного американского режиссера, за то, что им были нарушены авторские права. Истец желает, чтобы американский режиссер признал участие писателя в создании сценария фильма «Аватар», а также же хочет получить компенсацию за моральный ущерб в размере десяти миллионов российских рублей. Знаменитый режиссер из Голливуда обвинялся в плагиате этим писателем еще в 2015 году. Оказалось, что в фильме присутствуют сюжетные линии, которые были придуманы Закриевым при написании романа под названием «Секретное оружие». Писатель желает добиться справедливости и просит в этом помочь Владимира Путина, российского президента, о чем написал в своем открытом письме главе Российской Федерации. Тогда же весной литератор обратился в суд Александровского района Ставропольского края, с требование взыскать с американского режиссера сумму в 1 миллиард долларов. Вот только иск этот был отклонен. О том, как комментирует сложившуюся ситуацию Заводской районный суд Грозного, представителям средств массовой информации узнать пока не удалось. Роман Закриева с названием «Секретное оружие» находится в свободном доступе с 2002 года. Его создатель уверен, что сюжетные линии были использованы в фильме «Аватар». Сам писатель говорит об этом с уверенностью и утверждает, что его предположения могут подтвердить регистрация прав на роман и заключение экспертов. Писатель обращает внимание на то, что представители известного голливудского режиссера не отрицают, что в фильме «Аватар» и в романе «Секретное оружие» имеются некоторые сходства, вот только они переворачивают все так, будто бы это Закриевым была украдена идея. Писатель желает, чтобы его официально признали соавтором сценария к фантастической истории, а также выплатили компенсацию. После этого он готов работать с Кэмероном над созданием продолжения «Аватара», который смог завоевать звание самой кассовой кинокартиной за всю историю кино. Стоит вспомнить, что иные писатели ранее также заявляли о краже их идей. Ранее иск против режиссера «Аватара» подавали Эрик Райдер, Эмил Мэлак, Чжоу Шаомоу и Келли Ван.	https://kulturologia.ru//news/6062/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
695e1bd8-fefc-48f7-a654-f7029f5a65d7	Сочи и Лас-Вегас станут площадками для съемок новой российской художественной киноленты	кино;Лас-Вегас;Сочи;фильм	 Кинокомпания «2Д Целлулоид» намерена снимать фильм с название «В поисках мамы». Особенностью является то, что съемки киноленты будут проводиться в двух городах. Первым городом является американский Лас-Вегас, вторым – российский город Сочи. Павел Майоров, генеральный директор Корпорации развития Краснодарского края, рассказал об этом новостным изданиям. При этом им было отмечено, что кинокомпания и корпорация успели подписать договор на сопровождение съемок. Режиссером фильма выбрали Евгения Шуляпина, продюсером стал Василий Соловьев. Новая киноистория расскажет про мальчика, который обладает способность производить в уме вычисления с большими цифрами. У главного героя нет родителей, и он решает отправиться на поиски мамы. Как уже говорилось, съемки будут проводиться в Лас-Вегасе и в Сочи. Большая вероятность того, что съемки будут проводиться и в новом образовательном центре «Сириус». Предположительно в прокат этот фильм попадет в сентябре следующего 2020 года. Главной особенностью фильма будет то, что построен он на основе семейных ценностей. Мальчик, с удивительными способностями к вычислениям в уме, на своем пути встречает молодого человека, который увлекается азартными играми. Этот парень решает, что новый знакомый будет ему полезен и решает использовать в своих целях. Постепенно знакомые сближаются и превращаются в настоящую семью. Это должно показать зрителям, что не всегда семья может быть у человека от его рождения, ее можно найти. Договор о сопровождении съемок был подписан на Российском инвестиционном форуме в рамках дискуссионной панели, в ходе которой обсуждалось инвестирование в производство фильмов. В Краснодарском крае на площадке, посвященной развитию киноиндустрии, знаменитый Стивен Сигал, актер из Америки, провел свое автограф-сессию. Майоров отметил, что система мер по поддержанию кинематографа только начала формироваться в этом году, в дальнейшем планируют ее только развивать. На инвестфоруме впервые появилась площадка, которую было принято посвятить инвестициям в производство фильмов. Регион будет и дальше делать все для того, чтобы привлечь к себе внимание инвесторов, желающих проводить съемки фильмов в Краснодарском крае.	https://kulturologia.ru//news/6061/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
b6389b48-747b-48a0-9857-2aeb0d395a8b	В музейных фондах начались дополнительные ревизии после пропажи старинной иконы из ГИМ	иконы;музей;старина	 Олег Колтунов, заместитель начальника уголовного розыска Москвы, рассказал о том, что сейчас в российской столице проводятся дополнительные проверки музейных фондов. Причиной их проведения стала кража из Государственного исторического музея иконы «Богоматери Смоленской-Шуйской», которая была изготовлена в XVI веке. По факту пропажи этого ценного объекта было возбуждено уголовное дело. Специалисты в деталях изучили, как данная икона двигалась от одного музейного фонда к иному. В результате таких исследований было установлено, что после окончания выставки, проходившей в Муроме, икона вернулась в музей, где была поставлена на баланс исторических ценностей. После этого о местонахождении этого объекта нет никакой информации. По всей Москве были организованы дополнительные ревизии музейных фондов, которые должны помочь определить, куда могла деться данная икона «Богоматери». О том, что Государственный исторический музей лишился ценного экспоната, стало известно некоторое время назад. Изначально музей пытался собственными усилиями отыскать икону, вот только все предпринятые попытки успеха не принесли, и пришлось обращаться за помощью в правоохранительные органы. Старинная икона «Богоматерь Смоленская-Шуйская» была создана в XVI веке в Вологде. В связи с пропажей данного ценного объекта правоохранительные органы затеяли проверку, которая началась в январе. Представители Государственного исторического музея во время общения с полицией рассказали, о том, что последний раз ее выставляли в Мурманском художественном музее, но в августе она была возвращена в фонд живописи ГИМ. В последний месяц прошлого 2018 года в музее начали подготовку к выaставке, и икона не была выдана хранителем, чтобы стать частью экспозиции. В связи с этим решили начать проверку фондов музея, провели расследование, показавшие, что в Государственном историческом музее этой иконы нет. В пресс-службе самого ГИМ говорят о том, что в данный момент проводятся работы по сверки фонда древнерусской живописи. Данный фонд насчитывает близко 30 тысяч единиц. Если сверка будет завершена, а иконе не найдена, тогда будет сделано официальное заявление о пропаже старинной иконы. Сверка проходит медленными темпами, учет затруднен тем, что в данный момент фонд древнерусской живописи находится во временном хранилище, ведь в стационарном фондохранилище ведутся реставрационные работы. Икона имеет небольшие размеры и среди иных предметов фонда найти ее непросто.	https://kulturologia.ru//news/6059/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
e3bd0cf9-348a-458d-82a4-e91956f2e388	Музей современной истории России подал заявку на создание экспозиции в Собиборе	война;история;Собибор	 Директор Музея современной истории России Ирина Великанова рассказала на своей страничке в социальной сети о ближайших планах. Этим учреждением была составлена и направлена заявка на организацию постоянной выставки в мемориальном польском комплексе, который сейчас находится на месте концентрационного лагеря Собибор. Это заявка на участие в конкурсе. Данный конкурс должен определить победителя, которому и предстоит заниматься разработкой дизайна постоянной выставки в Собиборе, на месте бывшего лагеря смерти. Заявка на участие в данном конкурсе была отправлена 11 февраля в головной офис «Майданека» - мемориального музея, который находится под Люблином. Мемориал в Собиборе является филиалом этого мемориального музея. Открытие постоянной экспозиции планируют провести в Собиборе на месте, где во времена Второй мировой войны находился концентрационный лагерь. Если все пройдет по плану, то данная выставка будет открыта уже в следующем 2020 году. Стоит вспомнить, что в 2013 году Российской Федерации поступило предложение войти в число участников проекта по обновлению мемориального комплекса, расположенного в Собиборе. Данный проект был разработан Польшей, Словакией, Израилем и Нидерландами. Российская сторона с радостью приняла такое приглашение. Вот только летом 2017 года она перестала быть участницей данного проекта. Дальнейшее сотрудничество решили продолжить без Российской Федерации. Директор музея рассказала, что одержать победе в конкурсе российским музеям будет непросто. Есть предположение, что польская сторона постарается сделать все для того, чтобы Россия не смогла стать в нем победителем. Основанием для таких предположений является то, что представителей от нее нет даже в организационном комитете, который отвечает за разработку содержательной концепции музея. При этом Россия не могла остаться в стороне, она обязана принимать участие в таком конкурсе, чтобы показать всем, что она помнит и чтит тот подвиг, который во времена Второй мировой войны был совершен Печерским. На участие в данном конкурсе от Российской Федерации заявки еще послали Российское военно-историческое общество и Музей Победы. Победителя этого мероприятия должны объявить до 30 апреля 2019 года.	https://kulturologia.ru//news/6058/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
8b139dd9-4f4f-4e10-9bab-6ea44fec4c65	Эксперты: фильмы об острых социальных проблемах должны выходить в широкий прокат	 кино; общество	 7 февраля в прокат вышел фильм с названием «Завод». Выход этой российской кинокартины журналисты новостных изданий попросили прокомментировать Марию Лемешеву, главного редактора журнала с названием «КиноРепортер». По ее мнению, картины, в которых поднимаются острые социальные вопросы, обязательно должны выходить в широкий прокат. На большие экраны в четверг вышел фильм с названием «Завод». Эта история рассказывает про противостояние простых заводских рабочих с хозяином данного предприятия, который намерен закрыть его, так как завод стал убыточным. При этом в течение шести месяцев он намерен полностью выплатить сотрудникам всю задолженность по заработной плате. Зрителям показывают, как непросто приходится нескольким сотням простых рабочих, которым негде работать, и у которых нет денежных средств, чтобы жить дальше. Над созданием этой киноленты работал режиссер Юрий Быков. Во время своего интервью Лемешева рассказала, что фильмы, в которых обсуждаются социальные проблемы, обязательно должны показывать на больших экранах, особенно если это фильмы, создаваемые на профессиональном уровне. Подобные кинокартины могут стать подспорьем в устранении некоторых социальных проблем или хотя бы в их смягчении. Они обязательно сделают свой особый вклад в киноискусство. Ей самой пришлась по душе работа Быкова «Завод». Она отметила, что режиссер чувствует действительность, о которой ему приходится снимать фильма, умело передает все свои переживания и прочие эмоции, чтобы их смог прочувствовать каждый зритель. Удивительным талантом этого режиссера Лемешева назвала еще и способность всего за считанные минуты раскрыть перед зрителями того или иного персонажа картины, чтобы они четко поняли, что он собой представляет, и по каким причинам совершает определенные поступки. Руслан Татаринцев, который является продюсером «Завода», рассказал, что у зрителей сегодня большой интерес вызывают кинокартины, в которых обсуждаются острые социальные проблемы. Все предпремьерные показы, которые проходили в разных российских городах, собирали полные залы зрителей. Билеты на показ новой ленты в первом зале «Октября» полностью были проданы за 24 часа. После титров зал наполнился аплодисментами, а это говорит о том, что фильм действительно получился хорошим и нашел отклик у зрителей. Особое внимание продюсер обратил на то, что такими фильмами больше всего интересуется молодежь, так как именно ее больше всего было на предпремьерных показах.	https://kulturologia.ru//news/6057/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
b8a387f3-026d-4f8e-95a3-115e8da85a81	Первый инклюзивный рок-фестиваль прошел во Владивостоке 	Владивосток;рок;Россия;фестиваль	 9 февраля во Владивостоке прошел первый инклюзивный рок-фестиваль, которому дали название «Арт-интеграция». Местом его проведения стала площадка, «Андеграунда» - молодежного театра. Виктор Омельницкий, который является режиссером документального социального кино, выступил организатором данного мероприятия. Во время своего общения с журналистами он рассказал, что всего в данном мероприятии приняло участие 16 музыкальных коллективов. Особое внимание он акцентировал на том, что в трех таких коллективах участвуют лица с ограниченными возможностями.\r\nКоллективы, которые участвовали в первом инклюзивном рок-фестивале, играли разную рок-музыку. Гости мероприятия услышали здесь истинно тяжелый рок и лирические произведения, в которых в качестве дополнительных инструментов выступали труба и скрипка. В этот раз выступало всего 16 музыкальных коллективов, в числе которых были и люди с инвалидностью. Организаторам хотелось бы, чтобы людей с ограниченными возможностями на площадке было больше. Они надеются, что такой фестиваль станет постоянным, и с каждым годом на нем будет выступать все больше музыкантов-инвалидов. Подобным образом они хотят показать, что люди, которые имеют физические недостатки, при этом могут быть очень талантливыми. Организатор рассказал, что в фестивале принимали участие, как молодые музыканты от 12 лет, так и исполнители в возрасте – до 65 лет. В числе музыкантов был Евгений Некрасов, студент Дальневосточного федерального университета. У молодого человека нет кисти правой руки, но это не помешало ему научиться играть на гитаре после ее потере. Изначально игра на гитаре помогала ему социализироваться, теперь же он входить в число профессиональных музыкантов. Во время своей речи организатор Виктор Омельницкий отметил, что рок является музыкальным направлением, которое способствует объединению, стиранию границ, устранению стереотипов. Во Владивостоке на первом фестивале «Арт-интеграция» прошли выступления панк-коллективов, которые являются известными на Дальнем Востоке. На данное мероприятие были приглашены воспитанники дома-интерната. Им такое мероприятие, музыка и все происходящее на фестивале пришлось по душе, хотя сами воспитатели, возможно, имели совсем иное мнение.	https://kulturologia.ru//news/6056/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
9d59576f-5a4e-4f0c-80a0-1d70248b0330	Мемориальную доску писателю Даниилу Гранину открыли в Петербурге	 достопримечательности;Даниил Гранин;писатель;Санкт-Петербург	 В Санкт-Петербурге на доме с номером 8, который находится на Малой Посадской, открыли мемориальную доску гражданину города. Этим почетным гражданином является ушедший из жизни в 2017 году писатель Даниил Гранин. Данный дом выбран неспроста, а потому что в нем данный писатель жил и творил в течение 60 лет. Торжественное открытие мемориальной доски стало началом Года Гранина, который решили посвятить столетию со дня рождения этого талантливого человека. На торжественной церемонии открытия присутствовала Валентина Матвиенко, председатель Совета Федерации, которая возложила цветы в этой мемориальной доске. Автором ее стал Евгений Бурков, скульптор из Санкт-Петербурга, который входит в Союз художников России. Именно его проект больше всего приглянулся Марине Чернышовой-Граниной, дочери писателя. Портрет Даниила Александровича выполнен бронзой на розовом граните, а под барельефом начертан золотыми буквами автограф писателя. За открытие торжественной церемонии отвечал Сергей Степашин, президент Российского книжного союза. Во время открытия он напомнил, что в этом доме Гранин жил много лет. Именно в его стенах были созданы такие произведения как «Последняя тетрадь», «Зубр», «Блокадная книга» и «Мой лейтенант». В субботу был дан старт марафону по сбору книг, которые по окончании акции будут отправлены в школы, действующие в селах Российской Федерации. На церемонии много говорили о писателе. Зоя Чалова, президент Петербургского библиотечного общества, рассказала, что Гранин дружил с библиотеками, причем не только питерскими, а и с библиотеками иных городов страны. Произведения данного автора востребованы, читатели им интересуются. Причиной большого интереса считаю то, что все герои работ Гранина существовавшие в реальности люди, которые просто перешли в книги. Писатель всегда старался отстаивать библиотеки, так как считал такие организации очень уязвимыми и библиотекари были ему благодарны за такую позицию. Она же напомнила о том, что в Невском районе открыта новая библиотека, которая носит имя Даниила Гранина. На базе библиотеки действует культурный центр. Присвоение имени писателя данной библиотеки состоялось еще при его жизни, и он воспринял это с большой благодарностью.	https://kulturologia.ru//news/6055/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
7ebc1699-8882-4f34-b1a9-e89b8f1f6de0	Кинофестиваль «Берлинале» открылся фильмом «Доброта незнакомцев»	Берлинале	 В Берлине 7 февраля прошло открытие Берлинале. Этот международный Берлинский фестиваль проводится уже в 69 раз. С мая 2001 года руководителем данного конкурса является Дитер Косслик, который в этот раз также отвечает за старт данного смотра. Уже весной заканчивается его контракт. Близкий уход Косслика с должности директора Мариус Мюллер-Вестернхаген, немецкий рок-музыкант, называет уходом целой эпохи. Моника Грюттер, министр культуры ФРГ, рассказала, что больше всего в этом году Косслика порадовали зрители, которые выстраивались в длинные очереди перед кассами, что приобрести билеты и попасть на церемонию открытия кинофестиваля. Данный международный кинофестиваля решили открыть показом «Доброты незнакомцев». Это драма, над которой работа режиссер Лоне Шерфиг из Дании. Данная кинолента входит  в основную конкурсную программу. Помимо нее в данную программу входит еще 16 кинолент. Первый фильм, показанный в этот раз на «Берлинале», рассказывает о непростой судьбе женщины, которая вынуждена было взять своих двух маленьких детей и убежать от агрессивного мужа. В Нью-Йорке ей приходится не легко, так как нет средств к существованию, и она с трудом сводит концы с концами. Режиссер во время представления работы рассказал о том, что современный мир очень непростой, но важно всегда помнить о том, что в конце каждого тоннеля есть свет. К речи режиссера решил присоединиться один из актеров Билл Найи из Британии. Он добавил, что снимать следует такие ленты, которые не будет разделять людей, а наоборот, будут направлены на их объединение. Лауреатов планируют назвать 16 февраля. Определением достойных будет заниматься профессиональное жюри, главой которого в этот раз стала Жюльет Бинош – актриса из Франции. Сам смотр фильмов, которые достойны стать победителем международного фестиваля, пройдет днем позже. Участниками международного Берлинского кинофестиваля стали два русских фильма. Первый фильм от режиссера Александра Горчилина с названием «Кислота» включили в программу «Панорама», которая в этом смотре является второй по значимости. Второй фильм - «Мальчик русский» от режиссера Александра Золотухина, стал участником программы «Форум». «Берлинале» - это престижный кинофестиваль, который ставят в один ряд с Венецианским фестивалем и Каннским фестивалем. Каждый год данное мероприятие посещает более 300 тысяч зрителей, тысячи журналистов, на нем представляют сотни кинофильмов.	https://kulturologia.ru//news/6054/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
d3ca8573-e12f-4682-ba0d-dab3628c3ab7	Американская художница восстановила первоначальный облик «Моны Лизы»	Мона Лиза;художница	 Американская художница-реставратор восстановила изображение полотна Леонардо да Винчи «Мона Лиза» в том виде, в каком оно могло существовать в XVI веке. Копия художницы значительно отличается от существующего оригинала, главным образом своей цветовой палитрой. Причина тому в возрасте картины. Над созданием копии работала Дженнес Кортес. Стоит добавить, что художница рисует в жанре классического реализма. Во время работы Кортес основывалась на сведения о картине из Центра музейных исследований и реставрации Франции. Помимо этого была проделана огромная изыскательская работа. Были проанализированы многочисленные исторические сведения о полотне-оригинале, его копиях, проведен анализ поверхности картины и красящего состава, использовавшегося для создания полотна. Современная «Джоконда» достаточно сильно отличается от оригинала созданного Леонардо. Многие участки на копии значительно светлее, другие наоборот – темнее. По словам Кортес причина отличий заключается в естественных химических процессах, происходящих в лаке. Влияют на картину также влажность, чрезмерная чистка и другие реставрационные работы. В результате всего этого с полотна начинают исчезать наименее стойки пигменты лака. Помимо всего этого Кортес полностью восстановила некоторые утраченные участки полотна, например брови. Были отреставрированы и многие другие мелкие детали. Дженнес Кортес выразила надежду на то, что ее «Джоконда» понравится всем, кто ее увидит. Реставратор добавила, что вложила в полотно-копию все свои знания, силы и страсть, и очень надеется на то, что «над ней парила также игривая муза, что и когда-то над Леонардо». При всем при этом американка отметила, что не в коем разе не претендует на соревнование с великим мастером.	https://kulturologia.ru//news/6036/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
2d4a6e76-7f8e-4666-bb1c-8dd6eae845da	Объявлены номинанты на кинопремию «Оскар-2019»	 кино;номинанты;Оскар	 В 5:20 по времени западного побережья Соединённых Штатов Америки, что соответствует 16:20 по московскому времени, в Лос-Анджелесе Американской киноакадемией киноискусства будут названы номинанты на престижную премию. Церемонию объявления номинантов будет транслировать американский канал АВС. Ответственными за объявление номинантов стали Кумэйл Нанджиани - актер из Америки пакистанского происхождения, который известен по комедийному сериалу с названием «Силиконовая долина» и Трейси Эллис - актриса из Америки, которая в сериале «Подруги» сыграла главную роль. Премия «Оскар» присуждается всего в 24 номинациях. В их число входят «Лучший фильм на иностранном языке», «Лучший режиссер», «Лучший фильм» и прочие. Отдельные награды каждый год вручаются лучшему актеры и лучшей актрисе. Претендовать на получение данной престижной кинопремии могут только кинокартины, которые в год до проведения торжественной церемонии не менее семи дней подряд находились в прокате на территории округа Лос-Анджелес. В категорию «Лучший фильм» может быть включено от пяти до десяти кинокартин. Во все остальные номинации максимальное количество претендентов ограничено пятью. После объявления номинантов будет проводиться второй тур голосования. Принимать участие в нем будут члены Американской киноакадемии искусств. Этот второй этап продлиться до 19 февраля, когда и будут определены лауреаты. Многие кинокритики и прочие специалисты в области киноискусства склоняются к тому, что с большой вероятностью победителем в номинации «Лучший фильм» может стать кинокартина с названием «Звезда родилась», над созданием которой трудился режиссер Брэдли Купер. Это мелодрама, рассказывающая про любовь молодой начинающей певицы и известного исполнителя, выбравшего для себя стиль кантри. Достойной получения «Оскара» называют и драму с названием «Рома» от режиссера Альфонсо Куарона. Это история о простой мексиканской семье с драматической судьбой. Описываемые в фильме события происходят в 70- годы ХХ столетия. Большие шансы стать лучшим и у фильма «Зеленая книга» режиссера Питера Фаррелли. Это фильм, который рассказывает о путешествии она Ширли, известного джазового пианиста и Тони Липа, охранника и водителя. Данные три киноленты больше всего выделяются на фоне остальных, по мнению журнала Variety. У каждого из этих фильмов шансы получить главную награду от Американской киноакадемии искусств составляют 98-99%.	https://kulturologia.ru//news/6034/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
8a7341da-2d28-49f4-8c10-ce76e7a31e70	Трампа номинировали на «Золотую малину» как «Худшего актера»	 кино;Трамп;«Золотая малина»	 21 января 2019 года на сайте кинопремии с название «Золотая малина» появился список номинантов в категорию «Худший актер». В данном списке есть и имя Дональда Трампа, который является действующим президентом Соединенных Штатов Америки. В номинацию на получение такой кинопремии глава американского государства попал за участие в съемках документального фильма «Смерть нации». Этот фильм создавался под руководством режиссера Динеша Д'Соузы, а также за участие в создании ленты с названием «Фаренгейт 11/9» от режиссера Майкла Мура. На сайте говорится, что все в тех же картинах Дональд Трамп со своей неискоренимой мелочностью был номинирован и в еще одной категории с названием «Худший актерский дуэт». В фильме «Фаренгейт 11/9» появилась и супруга американского президента Мелания Трамп, которую в связи с этим решили добавить в число номинантов в категорию «Худшая актриса второго плана». На звание самого «Худшего актера» прошедшего года в этот раз кроме главы Америки претендуют еще Брюс Уиллис за участие в фильме «Жажда смерти», Джон Траволта за его роль в «Кодекс Готти», за съемках в фильме «Холмс & Ватсон» был номинирован Уилл Феррелл. Есть в списки и имя Джонни Деппа, куда он попал из-за «Шерлока Гномса». «Золотая малина» подразумевает определение и самой «Худшей актрисы». Номинантами в данной категории стали Хелен Миррен за участие в съемках фильма «Винчестер, дом, который построили призраки», Дженнифер Гарнер, которая снималась в фильме «Багровая мята», Аманда Сайфред, Эмбер Херд – актриса из фильма «Лондонские поля». В число номинантов вошла и Мелисса Маккарти, снявшаяся в фильме с названием «Игрушки для взрослых». Стоит вспомнить о том, что в Соединенных Штатах Америки вручение премии «Золотая малина» приводится каждый год. Традиционно данная церемония проводится за день до торжественного мероприятия, где будут называть лучших и вручать престижную премию «Оскар». Актеры, ставшие худшими, в «Золотой малине» получают награду – ягоду золотого цвета, выполненную из пластика. Стоимость этой награды не меньше пяти американских долларов. Название награды было взято от английского слова «raspberry». В дословном переводе оно означает «малина», но в сленге используется для определения презрения. В прошлом году данную награду в категории «Худший фильм» вручили мультфильму «Эмоджи фильм».	https://kulturologia.ru//news/6033/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
c747649f-beb7-46ee-9db2-a8bbc20d294e	Пьесу «Мастер и Маргарита» показывают на Манхэттене на английском языке	Булгаков;Манхэттен;спектакль;театр	 В Русском художественном театре, который расположен на Манхэттене, идёт показ пьесы с названием “Мастер и Маргарита”, поставленной по всемирно известному одноименному произведению русского писателя Михаила Булгакова. Впервые данная пьеса была показана летом 2017 года и вызвала очень большой интерес у зрителей. В связи с этим ее решили показать вновь. Показы возобновили в конце прошлого 2018 года и они ведутся до сих пор. Всего было выпущено более 50 спектаклей. Об этом рассказал Сергей Бураго, режиссер и художественный руководитель театра, во время своего общения с журналистами. Бураго отметил, что на каждом показе нет ни одного свободного места. За все время показа данную постановку успели посмотреть уже больше 4 тысяч человек. В конце этого месяца будет последний показ в сезоне. Если все пойдет по плану показ данного спектакля будет возобновлен в мае 2019 года. Режиссер рассказал и про интернациональный состав актеров, задействованных в спектакле. Китаянка по имени Ди Жу играет саму Маргариту. Том Шуберт из Бразилии играет Мастера и Иешуа, Роман Фрейд, закончивший Щукинское училище, играет роль Воланда, а Дэвид Рассел, актер из Америки, закончивший в Российской Федерации Щукинское училище, играет роль Ивана Бездомного. Актеры отлично справляются со своими ролями и доносят до зрителя все так, как это хочется режиссеру. Те смеются в нужных моментах, переживают за героев пьесы. Бураго рассказал, что очень сильно его беспокоит тема равновесия положения человека в обществе, и он хочет о ней постоянно говорить в своем театре. Постановка булгаковских «Мастера и Маргариты» должна помочь привить любовь иностранных граждан к российской культуре. Русские  русскоязычные люди, проживающие за пределами родины должны понимать, что родная культура становится все более значимой. Стоит отметить, что пьесу решили поставить на английском языке. Таким образом, по словам режиссера, проявляется уважение к культуре жителей Соединенных Штатов Америки. К тому же представления, которые являются понятными, оказываются более привлекательными для зрителей. В этой стране, да и во многих иных, всегда интересовались российской культурой. Особенно привлекательными для иностранцев являются Бунин, Пушкин, Цветаева, Набоков, Толстой, Гоголь, Достоевский и прочие классики.	https://kulturologia.ru//news/6032/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
3e286dfc-a59c-4d66-9883-7680da55f557	Сборы фильма «Т-34» в России и СНГ превысили 2 млрд рублей	СНГ;Т-34	 За последние выходные российский фильм под названием “Т-34”, который рассказывает про побег советских танкистов из немецкого плена, смог собрать по Российской Федерации и странам СНГ сумму чуть больше 177 миллиона рублей. Общие сборы с начала показа данной кинокартины на большом экране составили больше двух миллионов российских рублей. Столь внушительную сумму данной киноленте удалось собрать всего за три недели. Это фильм, который долго ждали. Многие зрители отметили, что не пожалели о посещении кинотеатра, так как такой фильм приятно смотреть именно с большого экрана. Фильм “Т-34”, над которым работал режиссер Алексей Сидоров, по итогам выходных по размеру собранной денежной суммы оказался только на втором месте рейтинга. Да это и не удивительно, ведь основная масса уже успела сходить на него раньше. В премиальных форматах эту киноленту выпустили в прокат еще 27 декабря 2018 года. В широкий прокат эта российская кинолента попала через несколько дней - 1 января нового 2019 года. На главные роли для съемок данной отечественной киноленты были приглашены такие знаменитые и узнаваемые актеры как Александр Петров, Анна Старшенбаум, Виктор Добронравов. На первом месте по собранной сумме в прокате по итогам прошедших выходных оказался фильм с названием “Стекло”, опередивший отечественный фильм о танкистах. Над созданием данной кинокартины трудился режиссер М.Найт Шьямалан. Новый кинофильм, собравший за выходные немного меньше 350 миллионов российских рублей, является продолжением таких фильмов как “Неуязвимый”, “Сплит”. Главные роли в данной киноленте сыграли знаменитые Сэмюэл Л. Джексон, Джеймс Макэвой и Брюс Уиллис. Третье место по размеру собранной суммы в прокате за последние выходные занял фильм с названием “Полицейский с Рублевки. Новогодний беспредел” от режиссера Ильи Куликова. На этой неделе он собрал 46,2 миллиона рублей. Сумма небольшая, но и в прокат этот фильм вышел достаточно давно, а потому многие успели посмотреть его. Премьера данной ленты состоялась 20 декабря ушедшего 2018 года. Главные роли в данной кинокартине сыграли полюбившиеся многим зрителям актеры Роман Попов, Сергей Бурунов и Александр Петров.	https://kulturologia.ru//news/6031/	80dcc487-ffcc-47fb-8284-f592f1a0b7bb
608725b2-4896-4aa1-ab3d-bdad89f2a2a8	«Рождественское» граффити Бэнкси в Уэльсе продали за $130 тыс.	граффити	 В городе Порт-Толбот на двух стенах гаража перед Рождеством появилось интересное граффити, создание которого приписывают уличному художнику, известному под псевдонимом Бэнкси. В пятницу Би-би-си, вещательная корпорация, рассказала о том, что эта последняя работа мастера, реальное имя которого длительное время не удается раскрыть, была продана по цене в 100 тысяч фунтов, что в переводе на доллары составляет около 130 тысяч. Владельцем последней работы всемирно известного уличного художника теперь является Джон Брандлер, который в уэльском сталелитейном центре владеет художественной галереей. Было отмечено, что ранее он уже приобретал работы Бэнкси и теперь просто решил пополнить коллекцию очередной работой этого загадочного мастера. С того момента, как стены гаража украсило очередное произведение искусства, полюбоваться им успело уже больше 20 тысяч человек. Место нанесения рисунка стало настоящим магнитом, как для местных жителей, так и для гостей города. Об этом уже рассказал новый владелец граффити Джон Брандлер. Он же высказал надежду на то, что в течение нескольких лет данное произведение уличного художественного искусства не покинет город. Для своей работы Бэнкси решил выбрать гараж, соседние стены которого образуют прямой угол. Произведение его представляет собой единую композицию. Изначально произведение кажется идеальным. Так на одной из стен находится изображение ребенка, неподалеку от которого находятся санки. Сам же он радуется падающим снежинкам, пытаясь поймать их руками и языком. Чувство кардинально изменяются, после того как зрители поворачивают за угол и видят продолжение художественной работы. Оказывает, что ребенок радуется не снежинкам с неба, а летящему пеплу, который поднимается от горящего контейнера. Данная работа уличного художника показывает, насколько нездоровой является атмосфера жизни в городе Порт-Толбот, а все потому, что данный приморский город стал местом устройства сталелитейного завода, принадлежащего компании Tata Steel, который в свою очередь является одним из самых крупных металлургических предприятий во всей Европе. Жители города часто наблюдают, как пепел от этого крупного предприятия покрывает автомашины, крыши домов и городские улицы. Чаще всего такие картины наблюдаются в июле. В городе Порт-Толбот на двух стенах гаража перед Рождеством появилось интересное граффити, создание которого приписывают уличному художнику, известному под псевдонимом Бэнкси. В пятницу Би-би-си, вещательная корпорация, рассказала о том, что эта последняя работа мастера, реальное имя которого длительное время не удается раскрыть, была продана по цене в 100 тысяч фунтов, что в переводе на доллары составляет около 130 тысяч. Владельцем последней работы всемирно известного уличного художника теперь является Джон Брандлер, который в уэльском сталелитейном центре владеет художественной галереей. Было отмечено, что ранее он уже приобретал работы Бэнкси и теперь просто решил пополнить коллекцию очередной работой этого загадочного мастера. С того момента, как стены гаража украсило очередное произведение искусства, полюбоваться им успело уже больше 20 тысяч человек. Место нанесения рисунка стало настоящим магнитом, как для местных жителей, так и для гостей города. Об этом уже рассказал новый владелец граффити Джон Брандлер. Он же высказал надежду на то, что в течение нескольких лет данное произведение уличного художественного искусства не покинет город. Для своей работы Бэнкси решил выбрать гараж, соседние стены которого образуют прямой угол. Произведение его представляет собой единую композицию. Изначально произведение кажется идеальным. Так на одной из стен находится изображение ребенка, неподалеку от которого находятся санки. Сам же он радуется падающим снежинкам, пытаясь поймать их руками и языком. Чувство кардинально изменяются, после того как зрители поворачивают за угол и видят продолжение художественной р